import React from "react";

import Calendar from "./components/Calendar";

import "./App.css";

class App extends React.Component {
  render() {
    return (
      <div className="App">
        <header>
          <div id="logo">
            <span className="icon">date_range</span>
            <span>
              <b>Thread</b>
            </span>
          </div>

          <div>
            <nav class="nav nav-pills nav-justified">
              <button class="nav-item nav-link">Internships</button>
              <button class="nav-item nav-link active">Events</button>
              <button class="nav-item nav-link">Mentors</button>
              <button class="nav-item nav-link disabled">Networking</button>
            </nav>
          </div>
        </header>
        <main>
          <Calendar />
        </main>
      </div>
    );
  }
}

export default App;
